import axios from "axios";

const API_URL = `${process.env.REACT_APP_API_URL}/lists`;

export const createList = async (newList) => {
  const response = await axios.post(`${API_URL}/create`, newList);
  return response.data;
};

export const fetchLists = async (userId) => {
  console.log("Calling server from fetchHelper");
  console.log(
    (`${API_URL}/list/${userId}`,
    {
      params: { userId: userId },
    })
  );
  const response = await axios.get(`${API_URL}/list/${userId}`, {
    params: { userId: userId },
  });
  return response.data;
};

export const getList = async (listId) => {
  const response = await axios.get(`${API_URL}/get/${listId}`);
  return response.data;
};

export const updateList = async (updateData) => {
  const response = await axios.put(`${API_URL}/update`, updateData);
  return response.data;
};

export const deleteList = async (listId) => {
  const response = await axios.delete(`${API_URL}/delete/${listId}`);
  return response.data;
};
